// SPDX-License-Identifier: MIT License
pragma solidity ^0.8.13;

import { MockCallee } from "./MockCallee.sol";

contract MockCall4 {

    address public constant CALLER = 0x6dfc34609a05bC22319fA4Cce1d1E2929548c0D7;
    address public constant CALLEE = 0xb0EdA4f836aF0F8Ca667700c42fcEFA0742ae2B5;

    // EXTCODECOPY doesn't show these whereas solc does
    bytes4 selector = MockCallee.coolFunc.selector;
    bytes4 anotherSelector = bytes4(keccak256(bytes("fakeFunc(uint256)")));

    uint[] public nums = new uint[](2);

    function dopeFunction() public {
        // solc doesn't show that there is a CALL opcode here, but EXTCODECOPY does
        (bool success, bytes memory data) = CALLEE.call(abi.encodeWithSelector(MockCallee.niceFunc.selector, 1));
    }

    function anotherDopeFunction() public {
        // solc doesn't show that there is a CALL opcode here, but EXTCODECOPY does
        (bool success, bytes memory data) = CALLEE.call(abi.encodeWithSelector(MockCallee.coolFunc.selector, 1));
    }
}

// SPDX-License-Identifier: MIT License
pragma solidity ^0.8.13;

contract MockCallee {

    uint coolNum = 0;

    function fakeFunc(uint256 num) public returns (uint) {
        coolNum = num;
        return 1;
    }

    function niceFunc(uint256 num) public returns (uint) {
        coolNum += num;
        return 2;
    }

    function coolFunc(uint256 num) public returns (uint) {
        coolNum += num;
        return 1;
    }

    function weirdFunc(uint256 num) public returns (uint) {
        coolNum += num;
        return 2;
    }
}

